import React, { Component } from 'react';
import { outerDivStyle, innerDivStyle, mainHeader, infoText, inputTextStyle, tertiaryHeader } from './ScreenStyles';

export default class SettingsScreen extends Component {
    render() {
        return (
            <div style = {outerDivStyle}>
                <div style = {innerDivStyle}>
                    <p style = {mainHeader}>Adjust your Settings</p>
                    <p style = {tertiaryHeader}>Change Display Name</p>
                    <input type = 'text' style = {inputTextStyle}/>
                    <p style = {tertiaryHeader}>Change Email</p>
                    <input type = 'text' style = {inputTextStyle}/>
                    <p style = {tertiaryHeader}>Change Password</p>
                    <p style = {infoText}>Enter old password.</p>
                    <input type = 'text' style = {inputTextStyle}/>
                    <p style = {infoText}>Enter new password.</p>
                    <input type = 'text' style = {inputTextStyle}/>
                    <p>{`\n`}</p>
                    <input type = 'text' style = {inputTextStyle}/>
                </div>
            </div>
        );
    }
}
